import { useState } from "react";
import styled from "styled-components";

const Tablerow = styled.div``;

const PostList = () => {
  return (
    <table>
      <tr>
        <th>Firstname</th>
        <th>Lastname</th>
        <th>Age</th>
      </tr>
      <tr>
        <td>Jill</td>
        <td>Smith</td>
        <td>50</td>
      </tr>
      <tr>
        <td>Eve</td>
        <td>Jackson</td>
        <td>94</td>
      </tr>
    </table>
  );
};
export default PostList;

const TableHead = () => {
  return (
    <>
      <div>번호</div>
      <div>제목</div>
      <div>작성자</div>
      <div>작성일</div>
    </>
  );
};
